import { Ticket } from '../models/ticket';

const dateToday: Date = new Date();

export const TICKETS_MOCKED: Ticket[] = [
  {
    title: 'SI4 in Madridista',
    description: 'Ticket de Paul !',
    date: dateToday,
    student: 'Paul',
    major: 'eng'
  },
  {
    title: 'SI5 in Paris CDG',
    description: 'Description du voyage',
    date: dateToday,
    student: 'Anna',
    major: 'doc'
  },
];
